# Part TWO -----------------------------------------------------------------------------------------------
# --------------------------------------------------------------------------------------------------------

chars = ''
shortestLength = len(data)

# For 0 to 25 (A to Z)
for c in range(26):
	
	polymers = data # For each letter get the original polymers...
	# ...improve polymers
	polymers = polymers.replace('{0}'.format(chr(97 + c)), '') #Replace all [lowerCase] characters with empty string
	polymers = polymers.replace('{0}'.format(chr(65 + c)), '') #Replace [upperCase] characters with empty string

	#Start improved polymers reaction
	polymersReacting = True
	while polymersReacting:
	
		polymersCopy = polymers.strip() #Get a copy of the polymers

		# For 0 to 25 (A to Z)
		for i in range(26):
			polymersCopy = polymersCopy.replace('{0}{1}'.format(chr(97 + i),chr(65 + i)), '') #Replace [lowerCase][upperCase] characters with empty string
			polymersCopy = polymersCopy.replace('{0}{1}'.format(chr(65 + i),chr(97 + i)), '') #Replace [upperCase][lowerCase] characters with empty string
	
		if(polymersCopy == polymers):
			polymersReacting = False
		else:
			polymers = polymersCopy

	if(len(polymers) < shortestLength):
		chars = '{0}/{1}'.format(chr(65 + c),chr(97 + c))
		shortestLength = len(polymers)

print('\nRemoving all {0} units was best, producing the answer {1}.\n'.format(chars, shortestLength))
